extern "C" {
    #[doc = " This function specifies the CPU affinity for a vcpu."]
    #[doc = ""]
    #[doc = " There are two kinds of affinity. Soft affinity is on what CPUs a vcpu"]
    #[doc = " prefers to run. Hard affinity is on what CPUs a vcpu is allowed to run."]
    #[doc = " If flags contains XEN_VCPUAFFINITY_SOFT, the soft affinity it is set to"]
    #[doc = " what cpumap_soft_inout contains. If flags contains XEN_VCPUAFFINITY_HARD,"]
    #[doc = " the hard affinity is set to what cpumap_hard_inout contains. Both flags"]
    #[doc = " can be set at the same time, in which case both soft and hard affinity are"]
    #[doc = " set to what the respective parameter contains."]
    #[doc = ""]
    #[doc = " The function also returns the effective hard or/and soft affinity, still"]
    #[doc = " via the cpumap_soft_inout and cpumap_hard_inout parameters. Effective"]
    #[doc = " affinity is, in case of soft affinity, the intersection of soft affinity,"]
    #[doc = " hard affinity and the cpupool's online CPUs for the domain, and is returned"]
    #[doc = " in cpumap_soft_inout, if XEN_VCPUAFFINITY_SOFT is set in flags. In case of"]
    #[doc = " hard affinity, it is the intersection between hard affinity and the"]
    #[doc = " cpupool's online CPUs, and is returned in cpumap_hard_inout, if"]
    #[doc = " XEN_VCPUAFFINITY_HARD is set in flags. If both flags are set, both soft"]
    #[doc = " and hard affinity are returned in the respective parameter."]
    #[doc = ""]
    #[doc = " We do report it back as effective affinity is what the Xen scheduler will"]
    #[doc = " actually use, and we thus allow checking whether or not that matches with,"]
    #[doc = " or at least is good enough for, the caller's purposes."]
    #[doc = ""]
    #[doc = " @param xch a handle to an open hypervisor interface."]
    #[doc = " @param domid the id of the domain to which the vcpu belongs"]
    #[doc = " @param vcpu the vcpu id wihin the domain"]
    #[doc = " @param cpumap_hard_inout specifies(/returns) the (effective) hard affinity"]
    #[doc = " @param cpumap_soft_inout specifies(/returns) the (effective) soft affinity"]
    #[doc = " @param flags what we want to set"]
    pub fn xc_vcpu_setaffinity(
        xch: *mut xc_interface,
        domid: u32,
        vcpu: ::std::os::raw::c_int,
        cpumap_hard_inout: xc_cpumap_t,
        cpumap_soft_inout: xc_cpumap_t,
        flags: u32,
    ) -> ::std::os::raw::c_int;
}
