pub struct e820entry {
    pub addr: u64,
    pub size: u64,
    pub type_: u32,
}
#[test]
fn bindgen_test_layout_e820entry() {
    assert_eq!(
        ::std::mem::size_of::<e820entry>(),
        20usize,
        concat!("Size of: ", stringify!(e820entry))
    );
    assert_eq!(
        ::std::mem::align_of::<e820entry>(),
        1usize,
        concat!("Alignment of ", stringify!(e820entry))
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<e820entry>())).addr as *const _ as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(e820entry),
            "::",
            stringify!(addr)
        )
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<e820entry>())).size as *const _ as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(e820entry),
            "::",
            stringify!(size)
        )
    );
    assert_eq!(
        unsafe { &(*(::std::ptr::null::<e820entry>())).type_ as *const _ as usize },
        16usize,
        concat!(
            "Offset of field: ",
            stringify!(e820entry),
            "::",
            stringify!(type_)
        )
    );
}
